import React from "react";
import "./header.modul.css";

import { createUseStyles } from "react-jss";

// =================================================================
const useStyles = createUseStyles({
  App: {
    backgroundImage: "url(" + "https://tsks.app/img/signin_balls.png" + ")",
    backgroundColor: "#181820",
    backgroundPosition: "top",
    backgroundSize: "contain",
    backgroundRepeat: "no-repeat",
  },
});

export default function Header() {
  return (
    <div className="Header position-fixed w-100 t-0 d-flex align-items-center justify-content-between ">
      <a className="header__logo" href="http://">
        todo
      </a>
      <div className="header__buttons d-flex align-items-center">
        <button
          href=""
          className="header__button button btn--none-border btn--hover-bb mb-0"
          style={{ marginRight: "2rem" }}
        >
          Sign in
        </button>
        <button
          href=""
          className="header__button button btn--border btn--hover-border mb-0"
        >
          Sign up
        </button>
      </div>
    </div>
  );
}
